package com.up42.task;

import static org.junit.Assert.assertTrue;
import static org.mockito.Mockito.when;

import java.util.Collections;
import java.util.Optional;

import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.mockito.Mock;
import org.mockito.junit.MockitoJUnitRunner;

import com.up42.task.repositories.UP42DataModelRepository;
import com.up42.task.repositories.model.generated.Feature;
import com.up42.task.repositories.model.generated.Properties;
import com.up42.task.repositories.model.generated.UP42DataModel;
import com.up42.task.services.FeatureService;

@RunWith(MockitoJUnitRunner.class)
public class FeatureServiceTest {

    @Mock
    private UP42DataModelRepository repository;

    private FeatureService featureService;

    @Before
    public void init(){

        featureService = new FeatureService(repository);
    }

    @Test
    public void getPreviewForFeatureTest(){

        String sampleId = "sample-id";

        when(repository.findByFeatureId(sampleId)).thenReturn(Optional.of(up42SampleDataModel()));
        final byte[] previewForFeature = featureService.getPreviewForFeature(sampleId);

        assertTrue(previewForFeature.length > 0);
    }

    public UP42DataModel up42SampleDataModel() {

        String imageBase64 = "";
        return UP42DataModel
                .builder()
                .features(Collections.singletonList(
                        Feature
                                .builder()
                                .properties(
                                        Properties
                                                .builder()
                                                .quickLook(imageBase64)
                                                .build())
                                .build()))
                .build();
    }
}
